  01> CACCIA-BIRCH, Candace Demi
  b 03.09.1994
  03>'CACCIA-BIRCH, Miriam m on 19.04.1956 to VIVIAN, John Hussey Hamilton
  Antoinette
  b 02.07.1933 d 09.01.1975
  b 01.01.1925
  Miriam b, at Marton and m. at the Savoy Chapel, London. Divorced 1973, John (4th Baron Swansea) b. at
  "Caer Beris", Builth Wells, Breconshire (now Powys), Wales. John remarried to Lucy Temple-Richards (nee
  Gough) on 29.12.1982. Address: 16 Cheyne Gardens, London SW3, England.
  Miriam was educated at Nga Tawa School, Marton and trained as a Karitane nurse. She travelled to UK
  where she met John while staying with her Caccia cousins in Wales, After their marriage they lived for
  many years at John's home, "Caer Beris", then in "Glanyrafon" in Wales. Later, while living in London,
  Miriam became a financial consultant and director of an international insurance company. She loved
  riding and entertaining and was a talented organiser and a tremendous worker. Miriam is remembered for
  her vibrant personality and generosity.
  John was educated at Eton College and Trinity College, Cambridge. He was a Deputy Lieutenant of Powys,
  a Provincial Grand Master of the Masonic Province of South Wales, a vice-president of the National
  Rifle Association since 1979 and president of the Welsh Rifle Association. He was captain of the Great
  Britain rifle team to Australia and New Zealand in 1979 and a member of the GB team on several other
  overseas tours and many home matches. He represented Wales at full-bore rifle shooting five times in
  the Commonwealth Games between 1966 and 1986, winning a gold medal in Kingston in 1966 and a silver in
  Brisbane in 1982.
  |
  01> VIVIAN, Richard Anthony m on 24.08.1996 to AUSTIN, Anna Clementine
  Hussey
  b 24.01.1957
  b 21.02.1967
  Richard b. at Caer Beris, Builth Wells, Breconshire (now Powys), Wales. Anna, d/o
  Michael and Lynette Austin, b. at Essendon, Victoria. Address: 42 Crowthorne Close,
  London SW18 5RX, England.
  Richard was educated at Eton College and Durham University. In 1973, while in the
  sixth form at Eton, he spent two terms at Christ's College, Christchurch. At Durham
  he served as President of the Durham Union Society before taking a BA degree in
  Chinese in 1979. He worked as a journalist in Hong Kong between 1979-83, first with the Hong Kong
  Standard newspaper and then with the financial wire service, Knight-Ridder. He then worked in the
  London bureau of later Knight-Ridder until 1989 when he turned freelance. In 1993 he joined the
  German news agency VWD as its chief metal markets correspondent, but left in 1996 in order to
  complete his MBA degree at the City University Business School.
  Richard now works as a freelance consultant in the field of metal markets and the mining industry,
  with particular interest in China. He has also served as a Conservative member of Wandsworth
  Borough Council since 1994.
  Anna grew up in Hong Kong where she attended Island School, and first met Richard in 1980. After
  leaving school, she worked as a proofreader and editor, first in Hong Kong and then, after
  returning to Australia in 1987, in Melbourne and Brisbane. In 1993 she moved to Auckland where she
  and Richard met again in early 1996. They were married later that year near Anna's family home in
  Sunbury, Victoria.
  Anna now works for a publishing house specialising in the medical device, diagnostics,
  pharmaceutical and agrochemical industries.
